import React from 'react';
import Navstuff from './components/Navstuff';

import {
  TaggedContentCard,
} from 'react-ui-cards';

function App() {
  return (
    <div>
  <Navstuff />

        <TaggedContentCard
          href='https://github.com/nukeop'
          thumbnail='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.livemint.com%2FIndustry%2FwBCts8macXD58uljl8X0UK%2FIndian-retail-sector-to-undergo-makeover-in-next-five-years.html&psig=AOvVaw1Gr_zw9BjZ7ov-iKAAJwpk&ust=1594911647341000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNii8I_Dz-oCFQAAAAAdAAAAABAD'
          title='Shop Name'
          description='Shop Description'
          tags={[
            'tag1',
            'tag2',
            'tag3'
          ]}/>
  </div>


  );
}

export default App;
